def return_binary_or_hexa(nums):
    a = nums[20]
    b = nums[36]
    total_sum = 0
    for i in range(a+1, b):
        if i not in nums[20:36]:
            total_sum += i

    if total_sum % 2 != 0:
        return bin(total_sum)[2:]
    else:
        return hex(total_sum)[2:].upper()
